import React, { Component } from 'react'

export class Header extends Component {
    render() {
        return (
          <div>
              <input type="text" 
                value={this.state.searchTag}
                onChange={this.updateSearch.bind(this)}/>
              <input type="text" 
                value={this.state.searchDescription}
                onChange={this.updateSearch.bind(this)}/>  
          </div>
        )
    }
}

export default Header
